import React, {useState} from "react";
import Styles from "./Menu.module.scss";
import SubMenu from "./SubMenu/SubMenu"

const Menu = (props) => {
    const {title, subMenu} = props;

    return (
        <div className={Styles.wrapper}>
            <p>{title}</p>
            <SubMenu titles={subMenu}/>
       </div>
    );
}

export default Menu;
